import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import '.fonts/arial-unicode-ms.ttf';
import './fonts/KRDEV011.tff';

ReactDOM.render(
    <React.StrictMode>
      <App />
    </React.StrictMode>,
    document.getElementById('root')
  );
